import React from 'react';

const Services = () => {
  return (
    <section id="services" className="py-24 px-6 bg-gray-100">
      <h3 className="text-3xl font-bold text-center text-gray-800 mb-10">Our Services</h3>
      <div className="grid md:grid-cols-3 gap-8 max-w-6xl mx-auto">
        <div className="bg-white p-6 rounded-xl shadow-md">
          <h4 className="text-xl font-semibold mb-3 text-blue-700">Virtual CFO</h4>
          <p>Strategic financial leadership, budgeting, and analytics without the full-time cost.</p>
        </div>
        <div className="bg-white p-6 rounded-xl shadow-md">
          <h4 className="text-xl font-semibold mb-3 text-blue-700">Tax & Compliance</h4>
          <p>End-to-end management of GST, Income Tax, MCA filings, and regulatory reporting.</p>
        </div>
        <div className="bg-white p-6 rounded-xl shadow-md">
          <h4 className="text-xl font-semibold mb-3 text-blue-700">Startup Advisory</h4>
          <p>From business registration to funding strategy, scale confidently with Finlytiq.</p>
        </div>
      </div>
    </section>
  );
};

export default Services;
